import React from 'react';
import Personlist from './Personlist'
import Searchbox from './Searchbox'
import {people} from './People'


const App =()=>{
    return (
        <div className='tc'>
            <div>
                <h1 className='georgia f2'>Passionate Moods</h1>
            </div>
            <div className='pb2'>
                <Searchbox/>
            </div>
            <Personlist people={people}/>
        </div>
    )
}



export default App;
